import React from 'react';
import phoneIcon from '../../assets/icons/phone.jpg';
import emailIcon from '../../assets/icons/email-icon.png';
import resumeIcon from '../../assets/icons/resume-logo.jpg';

import '../../assets/styles/contact.css';

function Contact() {
    return (
        <section className="dropdown-content bg-gray-50 ">
            <a className="flex" href="tel: +12813006033"><img className="contact-img" src={phoneIcon} alt="phone icon"/> 281.300.6033</a>
            <a href="mailto:angela.k.man@gmail.com"><img className="contact-img" src={emailIcon} alt="email icon" /> angela.k.man@gmail.com</a>
            <a href="https://drive.google.com/file/d/1ig66QVZOr92mOo0-YWz1qse_Eh5UgeaH/view?usp=sharing" target="_blank"><img className="contact-img" src={resumeIcon} alt="resume icon" /> Resume</a>
        </section>
    )
}

export default Contact;
